import React, { useState, useEffect } from 'react';
import './feed.css';

import Share from '../share/Share';
import Post from '../post/Post';

import { Posts } from '../../dummyData';

const Feed = () => {
  useEffect(() => {}, [input]);

  return (
    <div className='feed'>
      <div className='feedWrapper'>
        <Share />
        {Posts.map((post) => (
          <Post post={post} />
        ))}
      </div>
    </div>
  );
};

export default Feed;
